import React from "react";

function Welcome(props) {
  return (
    <div>
      <h1>Welcome to our Ads-System Admin Dashboard</h1>
      <h5>By Tomer Cohen, Guy Levy, Gili Shukrun, Shir Fogel and Omer Tati</h5>
      <p>Use the navigation bar above to start navigate in app</p>
    </div>
  );
}

export default Welcome;
